import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Search for 'nonexistent' in the event search input
    await page.waitForSelector('#eventSearchInput');
    await page.fill('#eventSearchInput', 'nonexistent');
    await page.click('button.search-btn');

    // Wait for the results to load
    await page.waitForSelector('.no-results-message', { timeout: 5000 });

    // Take a screenshot of the results
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_no_results.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_no_results.png'));

    // Extract meaningful data to verify task completion
    const noResultsMessage = await page.textContent('.no-results-message');

    return {
      success: true,
      action: "Searched for 'nonexistent' and verified no results were found",
      extractedData: { noResultsMessage },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}

